import React, { FC, useState } from 'react';
import { NavLink } from 'react-router-dom';
import styles from './Resume.module.scss';

interface ResumeProps {}

const Resume: FC<ResumeProps> = () => {

  const [embed,setEmbed] = useState(false);

  return(
    <div className={styles.Resume}>
            {!embed && <NavLink onClick={() => {
              setEmbed((prev) => !prev)
            }} className={styles.About__pdfBtn} to='#'>Show File</NavLink>}
            {embed && <NavLink onClick={() => {
              setEmbed((prev) => !prev)
            }} className={styles.About__pdfBtn} to='#'>Close File</NavLink>}
            <NavLink className={styles.About__pdfBtn} to={process.env.PUBLIC_URL + '/myResume.pdf'} download>Download in PDF</NavLink><br />
            {embed && <embed src={process.env.PUBLIC_URL + '/myResume.pdf'} type="application/pdf" width="75%" height="600px" />
}    
            </div>
  );
}

export default Resume;
